params.description:
objects with options:
     - limit {Number}
     - offset {Number}
     - order {String} 'asc' or 'desc'
     - filter {String}
     - prompt {String}
     - uris {Array}
     - complement {Boolean}
     - includeTotalCountWithoutFilters {Boolean}
     - restrictiveDefinition {String}

return.description:
ValidElements response with:
     - items {Array} elements
     - paging {Object}
     - elementsMeta {Object}

classitems.description:
Gets current timezone and its offset. Example output:

    {
        id: 'Europe/Prague',
        displayName: 'Central European Time',
        currentOffsetMs: 3600000
    }
